import React from "react";
import { Data } from "../data";
import Survey from './Survey';
import { Row, Col } from 'antd';
import '../assets/styles/Survey.css'

/* const style = { background: '#0092ff', padding: '8px 0' }; */

function Name(){
  return (
              Data.map((meet, i)=>
                  {
                    return (
                      <Row key={i} company={meet.company} justify="center" align="top" gutter={{ xs: 8, sm: 16, md: 24, lg: 32 }}>
                        <Survey>{meet.company}</Survey>
                      </Row>
                    )
                  }
                )
  );
}
export default Name;
